import sys

n = int(sys.stdin.readline())
s = sys.stdin.readline().strip()

count = 0

for i in range(n):
    for j in range(i, n):
        if s in s[i:j+1]:
            count += 1

print(count)

def get_substrings(s):
    substrings = []
    for i in range(len(s)):
        for j in range(i + 1, len(s) + 1):
            substrings.append(s[i:j])
    return substrings


def get_cyclical_substrings(s):
    substrings = []
    for i in range(len(s)):
        for j in range(i + 1, len(s) + 1):
            substrings.append(s[i:j])
            substrings.append(s[i:j][::-1])
    return substrings


def main():
    n = int(input())
    s = input()

    substrings = get_substrings(s)
    cyclical_substrings = get_cyclical_substrings(s)

    print(len(set(substrings).intersection(cyclical_substrings)))


if __name__ == '__main__':
    main()

