    n = int(sys.stdin.readline().strip())
    s = sys.stdin.readline().strip()

    count = 0
    for i in range(n):
        for j in range(i + 1, n + 1):
            if s in s[i:j]:
                count += 1

    print(count)

def countCyclicalBinaryStrings(s):
    n = len(s)
    count = 0
    for i in range(n):
        for j in range(i + 1, n + 1):
            if s[i:j] in s[j:]:
                count += 1
    return count

print(countCyclicalBinaryStrings(input()))
